const App = () => {
  const course = 'Half Stack application development'
  const part1 = 'Fundamentals of React'
  const exercises1 = 10
  const part2 = 'Using props to pass data'
  const exercises2 = 7
  const part3 = 'State of a component'
  const exercises3 = 14

  return (
    <div>
      <Header course={course} />
      <Content part={part1} e={exercises1} />
      <Content part={part2}  e={exercises2}/>
      <Content part={part3}  e={exercises3}/>
      <Total e1={exercises1} e2={exercises2} e3={exercises3}/>
    </div>
  )
}

const Header = (props) =>{
    return(<div>
        <h1>{props.course}</h1>
        </div>)

}

const Content = (props) =>{
return(
<div>   
    <Part p={props.part} e={props.e} />
</div>
)}

const Part = (props) =>{
return(
    <div>
    <p>{props.p} {props.e}</p>
    </div>
)
}

const Total = (props) =>{
return(
<div>
    <p>number of exercises {props.e1+props.e2+props.e3}</p>
        </div>
)
}
export default App
